import logo from './회전루피.gif';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a href = "https://www.naver.com/">
        <img src={logo} className="App-logo" alt="logo" />
        </a>
        <p>
          안녕하세요
          
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
